package io.navas.examples;

public class SwitchCase {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
 
		
		String name="x";
		
		
		switch(name) {
		
		
		case "muthu":
 
			System.out.println("Muthu");
			break;
			
		case "yacub":
			System.out.println("Muthu");

			
			break;
		
		case "mohammed":
			System.out.println("Muthu");

		
		break;
		case "navas" :
			
			System.out.println("navas");

			
			break;
			
			
			
	     default:
	    	 
	    	 System.out.println("name not found!!!!");
	    	 
	    	 break;
				
		
		}
	
	
	}

}
